bool translateString(const char *s,char *utf8){
  const unsigned char *ss=(const unsigned char *)s;
  unsigned char c,d;
  int utf8_pos=0,utf_len;
  bool shit_gbk = false;
  while(c=*ss++){
    bool local_lang;
    local_lang = false;
    //LOGE("is that gbk? c=%d", c);
    
    //changed by jwchen, fix 80636, gbk improving. 2011.01.14
    if(c>0x80 && c<GB_MIN_FIRST){
      //LOGE("continue");
      ss++;
      continue;
    }
    
    if(c>=GB_MIN_FIRST && c<GB_MAX_FIRST){
      //LOGE("firstdata is gbk");
      d = *ss++;
      if( d>=GB_MIN_SECOND && d<GB_MAX_SECOND ) {
        //LOGE("seconddata is gbk");
        
        //changed by jwchen, fix 80636, gbk improving. 2011.01.14
        shit_gbk = true;
        
        local_lang = true;
        memcpy(utf8+utf8_pos, &gbk_to_utf8_table[ 3 * ((c-GB_MIN_FIRST)*GB_ROW_LEN + (d-GB_MIN_SECOND)) ], 3);
        if ( utf8[utf8_pos+2] )
          utf8_pos += 3;
        else
          utf8_pos += 2;
      } else {
      
        //changed by jwchen, fix 80636, gbk improving. 2011.01.14
        if(shit_gbk){
            //LOGE("ignore unknown characters");
        }
        else{
            //LOGE("fail second ss=%s\n", ss-1);
            return false;
        }
        
      }
    }

    if(!local_lang) {
      if (c & 0x80) {
        utf8[utf8_pos++] = (c >> 6) | 0xc0;
        utf8[utf8_pos++] = (c & 0x3f) | 0x80;
      } else {
        utf8[utf8_pos++] = c;
      }
    }
  }

  utf8[utf8_pos]=0;
  return true;
}
